// Get all input items and categorize them
const allItems = $input.all();

const trainees = [];
const coaches = [];
const existingScores = [];
const assessmentData = [];

allItems.forEach(item => {
  const data = item.json;

  // Identify trainees by Training Start Date column
  if (data['Training Start Date'] !== undefined && data['Email Address']) {
    trainees.push(data);
  }
  // Identify coaches by Coach Email column
  else if (data['Coach Email'] && data['Coach Name']) {
    coaches.push(data);
  }
  // Identify existing scores by Score ID
  else if (data['Score ID']) {
    existingScores.push(data);
  }
  // Everything else with Timestamp is assessment data
  else if (data.Timestamp || data.timestamp) {
    assessmentData.push(data);
  }
});

console.log(`Trainees: ${trainees.length}, Coaches: ${coaches.length}, Existing: ${existingScores.length}, Assessments: ${assessmentData.length}`);

// Build lookup maps
const traineeMap = new Map();
trainees.forEach(t => {
  const email = (t['Email Address'] || '').toLowerCase();
  if (email) traineeMap.set(email, t);
});

const coachMap = new Map();
coaches.forEach(c => {
  const role = c.Role || c.Department || '';
  const country = c.Country || '';
  const key = `${role}-${country}`;
  if (!coachMap.has(key)) coachMap.set(key, []);
  coachMap.get(key).push(c);
});

// Build existing score lookup for deduplication
const existingKeys = new Set();
existingScores.forEach(s => {
  if (s['Form Response Id']) {
    existingKeys.add(s['Form Response Id']);
  }
});

// Helper: Normalize score to percentage
function normalizeScore(scoreVal) {
  if (!scoreVal && scoreVal !== 0) return 0;
  let str = String(scoreVal).trim();

  // Handle "30 / 40" format
  if (str.includes('/')) {
    const parts = str.split('/');
    const num = parseFloat(parts[0]) || 0;
    const denom = parseFloat(parts[1]) || 1;
    return Math.round((num / denom) * 100 * 100) / 100;
  }

  // Remove % sign
  str = str.replace('%', '');
  let num = parseFloat(str) || 0;

  // If decimal (0.93 = 93%), convert to percentage
  if (num > 0 && num <= 1) {
    num = num * 100;
  }

  return Math.round(num * 100) / 100;
}

const newScores = [];
let skippedCount = 0;

assessmentData.forEach((raw, idx) => {
  const timestamp = raw.Timestamp || raw.timestamp || '';
  const coachEmail = (raw['Email Address'] || '').toLowerCase();
  const traineeEmail = (raw['New Hire Email'] || raw['Trainee Email'] || '').toLowerCase();
  const traineeName = raw['New Hire Full Name'] || raw['Trainee Name'] || raw['Player Name?'] || '';
  const department = raw['Department/Role'] || raw.Department || raw.Role || raw.Team || '';
  const coachName = raw['Coach Name'] || '';

  // Get score from various possible columns
  const scoreRaw = raw.Score || raw.score || raw['Final Score'] || '';
  const remarks = raw['Remarks (Optional)'] || raw.Remarks || '';

  // Use Assessment Type (set by Set nodes or from form)
  const assessmentName = raw['Assessment Type'] || 'Unknown Assessment';

  if (!traineeEmail || !timestamp) return;

  // Create dedup key
  const dedupKey = `${traineeEmail}-${assessmentName}-${timestamp}`;
  if (existingKeys.has(dedupKey)) {
    skippedCount++;
    return;
  }

  // Get trainee info for country
  const trainee = traineeMap.get(traineeEmail) || {};
  const country = trainee.Country || raw.Country || 'Unknown';

  // Calculate attempt number
  let attemptNumber = 1;
  existingScores.forEach(s => {
    if ((s['Trainee Email'] || '').toLowerCase() === traineeEmail && 
        s['Assessment Name'] === assessmentName) {
      attemptNumber++;
    }
  });

  // Also count new scores we're adding in this batch
  newScores.forEach(s => {
    if (s.json['Trainee Email'] === traineeEmail && 
        s.json['Assessment Name'] === assessmentName) {
      attemptNumber++;
    }
  });

  // Normalize score and determine pass/fail
  const scoreNum = normalizeScore(scoreRaw);
  const scoreFormatted = scoreNum > 0 ? `${scoreNum}%` : '0%';
  const passed = scoreNum >= 70 ? 'Pass' : 'Fail';

  // Get coaches for this department/country
  const coachKey = `${department}-${country}`;
  const deptCoaches = coachMap.get(coachKey) || [];
  const coachEmails = deptCoaches.map(c => c['Coach Email']).filter(Boolean).join(', ');

  newScores.push({
    json: {
      'Score ID': `SCORE-${Date.now()}-${idx}`,
      'Trainee Email': traineeEmail,
      'Assessment Name': assessmentName,
      'Attempt Number': attemptNumber,
      'Score': scoreFormatted,
      'Passed': passed,
      'Evaluated By': coachEmail,
      'Evaluated At': timestamp,
      'Feedback': remarks,
      'Form Response Id': dedupKey,
      '_trainee_name': traineeName,
      '_department': department,
      '_country': country,
      '_coach_name': coachName,
      '_coach_emails': coachEmails || coachEmail
    }
  });

  existingKeys.add(dedupKey);
});

console.log(`New scores: ${newScores.length}, Skipped: ${skippedCount}`);

if (newScores.length === 0) {
  return [{ json: { _noNewScores: true, message: 'No new scores to process' } }];
}

return newScores;

const scores = $input.all();
const groups = new Map();

scores.forEach(item => {
  const s = item.json;
  const key = `${s._department}-${s._country}`;

  if (!groups.has(key)) {
    groups.set(key, {
      department: s._department,
      country: s._country,
      coach_emails: s._coach_emails,
      scores: []
    });
  }

  groups.get(key).scores.push({
    trainee: s._trainee_name,
    assessment: s['Assessment Name'],
    score: s.Score,
    passed: s.Passed,
    attempt: s['Attempt Number'],
    coach: s._coach_name
  });
});

const digests = [];

groups.forEach((group) => {
  let traineeList = '';
  group.scores.forEach(s => {
    const emoji = s.passed === 'Pass' ? '✅' : '⚠️';
    traineeList += `${emoji} ${s.trainee}\n   → ${s.assessment}: ${s.score} (Attempt #${s.attempt})\n\n`;
  });

  digests.push({
    json: {
      role: group.department,
      country: group.country,
      coach_emails: group.coach_emails,
      total_scores: group.scores.length,
      trainee_list: traineeList
    }
  });
});

if (digests.length === 0) {
  return [{ json: { _noDigest: true } }];
}

return digests;
